import Card from "../../layout/card/Card";
import "./HomePage.scss";
import Search from "../../layout/search/Search";
import MobileNav from "./mobile-nav/MobileNav";
import About from "./about/About";
import Footer from "../../footer/Footer";
import Header from "../../header/Header";
import PopularAssociations from "./PopularAssociations";
import SignatureDish from "./SignatureDish";
import Icons from "./Icons";
import { Fragment } from "react";
import { Link } from "react-router-dom";
import ChefItem from "./ChefItem";
import { useEffect } from "react";
import { fetchChefs } from "../../../store/chefDataSlice";
import { fetchDishes } from "../../../store/dishDataSlice";
import {fetchAssociations} from "../../../store/AssociationDataSlice";
import { useSelector } from "react-redux";
import { useAppDispatch} from "../../../store/store";

const HomePage = () => {
  const dispatch= useAppDispatch();
  const {Associations}= useSelector((state:any)=> state.restaurants);
  const {dishes}= useSelector((state:any)=> state.dishes);
  const {chefs}= useSelector((state:any)=> state.chefs);

  useEffect(() => {
    dispatch(fetchAssociations()) 
    dispatch(fetchChefs()) 
    dispatch(fetchDishes()) 
    },[]);


  return (
    <Fragment>
      <Header />
      <div className="card-bg">
        <Card>
          <p className="tlc-title">
            <h3>TLC</h3>
            Tender, Loving, Care
          </p>
          {/* <Search /> */}
        </Card>
      </div>
      <MobileNav />
      <div className="data-section">
        <p className="sub-title">THE POPULAR RESTAURANTS IN EPICURE : </p>
        <PopularAssociation data={restaurants} key={restaurants._id}/>
        <Link to={"/associations/all/1"} className="all-restaurants-desktop-btn">
          All Associations {">>"}{" "}
        </Link>
        <p className="sub-title">SIGNATURE DISH OF :</p>
        <SignatureDish dishes={dishes} key={dishes._id}/>
        <Icons />
      </div>
      <p className="sub-title">OUR DEVELOPERS</p>
      <ChefItem chef={chefs} restaurants={restaurants} key={chefs._id}/>
      <About />
      <Footer />
    </Fragment>
  );
};

export default HomePage;
